            return activator.contains(target as Node);
          }
          return false;
        },
        registerInteractionHandler: () => null,
        deregisterInteractionHandler: () => null,
        getWindowPageOffset: () => ({
          x: window.pageXOffset,
          y: window.pageYOffset,
        }),
      };
